import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input type="file" />
        <button onClick={getConvertedData}>Upload</button>
      </header>
    </div>
  );
}

interface ConversionData {
  success: boolean;
  query: {
    from: string;
    to: string;
    amount: number;
  };
  info?: {
    timestamp: string;
    rate: number;
  };
  date: string;
  result: number;
}

function getConvertedData(): Promise<any> {
  return fetch(
    "https://currency-conversion-and-exchange-rates.p.rapidapi.com/latest?from=USD&to=EUR%2CGBP",
    {
      method: "GET",
      headers: {
        "x-rapidapi-host":
          "currency-conversion-and-exchange-rates.p.rapidapi.com",
        "x-rapidapi-key": "your_api_key",
      },
    }
  )
    .then((r) => r.json()) // Parse the response in JSON
    .then((response) => {
      return response as ConversionData; // Cast the response type to our interface
    });
}

export default App;
